document.getElementById("graph_button").onclick = function clicks() {
	toggle("myccinput");
	string = document.getElementById("myccinput").value;
	var n = string.search(/\t/);
	var struct;
	if (n > 0) {
		struct = d3.tsvParse(string, d3.autoType);
	} else {
		struct = d3.csvParse(string, d3.autoType);
	}
	var headers = struct.columns;
	var axis = optimize_axis(headers, struct);
	headers.push("None");
	var init_val=headers[1];
	if (headers.length<4) {init_val="None"} 
	crossex("smartplot_id", struct, [
	{
		"name": "X_Axis",
		"value": axis[0],
		"bind": {
			"options": headers
		}
	}, {
		"name": "Y_Axis",
		"value": axis[1],
		"bind": {
			"options": headers
		}
	}, {
		"name": "Facet_Rows_By",
		"value": "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Facet_Cols_By",
		"value": "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Color_By",
		"value":  axis[4],
		"bind": {
			"options": headers
		}
	}, {
		"name": "Sum_By",
		"value":  "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Size_By",
		"value":  "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Opacity_By",
		"value": 'None',
		"bind": {
			"options": headers
		}
	}, {
		"name": "Filter_By_Value",
		"value": "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Filter_Additional",
		"value": "None",
		"bind": {
			"options": headers
		}
	}, {
		"name": "Filter_Out_From",
		"value": "None",
		"bind": {
			"options": headers
		}
	}],"About");
};

